import styled from "styled-components";

export const FieldsContainer = styled.div`
  width: 100vw;
  background-color: var(--main-background-color);
  display: flex;
  flex-direction: column;
  font-weight: 700;

  ul {
    li {
      list-style-type: none;
      display: flex;
      gap: 0.5rem;
    }
  }


`;
